void load_lenna( pixel * screen_src, int screen_width, int screen_height)
{
	int i,j;
	int height = lenna_height, width = lenna_width;
	if( width > screen_width) width = screen_width;
 	if( height > screen_height) height = screen_height;

	vbx_sp_push();
	vbx_uword_t *v_img = (vbx_uword_t *)vbx_sp_malloc(width * sizeof(vbx_uword_t));

	for(j = 0; j < height; j++){
		vbx_dma_to_vector( v_img, lenna +j*lenna_width, width * sizeof(vbx_uword_t));
		vbx_dma_to_host( screen_src +j*screen_width, v_img, width * sizeof(vbx_uword_t));
	}
	vbx_sync();
	vbx_sp_pop();
}
